CREATE TABLE FBI_TMP 
(
  ID NUMBER(*, 0) NOT NULL 
, CITY VARCHAR2(50 BYTE) 
, VIOLENT_CRIME NUMBER(*, 0) 
, PROPERTY_CRIME NUMBER(*, 0) 
, POPULATION NUMBER 
, CONSTRAINT FBI_TMP_PK PRIMARY KEY 
  (
    ID 
  )
  USING INDEX 
  (
      CREATE UNIQUE INDEX FBI_TMP_PK ON FBI_TMP (ID ASC) 
      LOGGING 
      TABLESPACE DBS_STUDENTEN 
      PCTFREE 10 
      INITRANS 2 
      STORAGE 
      ( 
        INITIAL 65536 
        NEXT 1048576 
        MINEXTENTS 1 
        MAXEXTENTS UNLIMITED 
        BUFFER_POOL DEFAULT 
      ) 
      NOPARALLEL 
  )
  ENABLE 
) 
LOGGING 
